const initialState = {
  photo: [],
  album: [],
  user: [],
};

export default function (state = initialState, action) {
  switch (action.type) {
    case "SET_PHOTO":
      console.log("masuk reducer");
      return {
        ...state,
        photo: action.payload,
      };
    case "SET_USERS":
      console.log("masuk reducer");
      return {
        ...state,
        photo: action.payload,
      };
    case "SET_ALBUM":
      console.log("masuk reducer");
      return {
        ...state,
        photo: action.payload,
      };
    default:
      return state;
  }
}
